import React from 'react';
import styled from 'styled-components';

const Section = styled.section`
  padding: 80px 20px;
  text-align: center;
  background: ${props => props.theme.colors.background};
  color: ${props => props.theme.colors.text};
  min-height: 50vh;
`;

const Title = styled.h2`
  font-size: 2rem;
  margin-bottom: 20px;
`;

const Paragraph = styled.p`
  max-width: 800px;
  margin: 0 auto;
  line-height: 1.6;
  font-size: 1.1rem;
`;

function ManifestoSection() {
    return (
        <Section id="manifesto">
            <Title>Our Manifesto</Title>
            <Paragraph>
                We believe in merging art, technology, and personal expression to create the perfect phonecase.
                Every design is meticulously crafted to embody style, comfort, and a hint of rebellious spirit.
                <br /><br />
                From bold neon statements to timeless marble patterns, our brand stands for individuality and quality.
                Join us on this journey to transform the everyday phone accessory into a vibrant extension of your personality.
            </Paragraph>
        </Section>
    );
}

export default ManifestoSection;
